//Method for editor that will help to clean scene

private Dictionary<GameObject, List<GameObject>> RemoveDuplicates()
{
    Dictionary<GameObject,List<GameObject>> poolCollection = new Dictionary<GameObject, List<GameObject>>();
    List<GameObject> allGameObjects = new List<GameObject>(GameObject.FindObjectsOfType<GameObject>());

    do
    {
        int current = allGameObjects.Count - 1;
        GameObject[] allGameObjectsCopy = allGameObjects.ToArray();
        GameObject gameObjectA = allGameObjects[current];
        GameObject prefabA = PrefabUtility.GetPrefabObject(gameObjectA) as GameObject;
        GameObject basePrefab = prefabA;

        List<GameObject> duplicates = new List<GameObject>();
        allGameObjects.Remove(gameObjectA);

        if (!prefabA)
        {
            if( gameObjectA.transform.childCount > 0)
            {
                Debug.Log($"{gameObjectA.name} is too complex to compare");
                continue;
            }
            else
            {
                basePrefab = PrefabUtility.CreatePrefab($"Assets/prefabs/{poolCollection.Count}_{gameObjectA.name}.prefab", gameObjectA as GameObject) as GameObject;
                gameObjectA = SwapToPrefab(basePrefab, gameObjectA);
            }

        }
        duplicates.Add(gameObjectA);


        foreach (GameObject gameObjectB in allGameObjectsCopy)
        {

            if (!gameObjectB || gameObjectA == gameObjectB)
                continue;

            GameObject prefabB = PrefabUtility.GetPrefabObject(gameObjectB) as GameObject;

            if ((prefabA && !prefabB) || (!prefabA && prefabB))
            {
                continue;
            }

            if (prefabA && prefabB && prefabA.Equals(prefabB))
            {
                duplicates.Add(gameObjectB);
                allGameObjects.Remove(gameObjectB);
                continue;
            }

            if (gameObjectB.transform.childCount > 0)
            {
                allGameObjects.Remove(gameObjectB);
                Debug.Log($"{gameObjectB.name} has childrens and can't be compared");
                continue;
            }

            bool sameMeshFilters = CompareMeshFilters(gameObjectA, gameObjectB);

            if (sameMeshFilters)
            {
                allGameObjects.Remove(gameObjectB);
                GameObject newGameObjectB = SwapToPrefab(basePrefab as GameObject, gameObjectB);
                duplicates.Add(newGameObjectB);
            }
        }

        Debug.Log($"{gameObjectA.name} has {duplicates.Count} duplicates");

        poolCollection.Add(basePrefab as GameObject,duplicates);

    } while (allGameObjects.Count > 0);

    Debug.Log($"Total objects in pool {poolCollection.Count}");
    return poolCollection;
}

private GameObject SwapToPrefab(GameObject basePrefab,GameObject objectToReplace)
{
    GameObject newGameObject = PrefabUtility.InstantiatePrefab(basePrefab) as GameObject;
    newGameObject.transform.position = objectToReplace.transform.position;
    newGameObject.transform.localScale = objectToReplace.transform.localScale;
    newGameObject.transform.parent = objectToReplace.transform.parent;
    DestroyImmediate(objectToReplace);
    return newGameObject;
}

private bool CompareMeshFilters(GameObject gameObjectA, GameObject gameObjectB)
{
    MeshFilter a = gameObjectA.GetComponent<MeshFilter>();
    MeshFilter b = gameObjectB.GetComponent<MeshFilter>();
    if (a && b && a.sharedMesh.vertices.Length == b.sharedMesh.vertices.Length)
    {
        int verticesEqualsCount = 0;

        for (int i = 0; i < a.sharedMesh.vertices.Length; i++)
        {
            if (a.sharedMesh.vertices[i] == b.sharedMesh.vertices[i])
            {
                verticesEqualsCount++;
            }
        }

        if (verticesEqualsCount == a.sharedMesh.vertices.Length)
        {
            return true;
        }
    }
    return false;
}

